import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { useSelector } from 'react-redux';
import Dropdown from 'react-bootstrap/Dropdown';
import { useNavigate } from 'react-router-dom';

function NavScrollExample() {
  const { userDetail } = useSelector(state => state.user);
  const navigate = useNavigate();

  const doLogout = () => {
    localStorage.clear();
    navigate('/');
  };

  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container fluid>
        <Navbar.Brand href="#" style={{ color: '#3C6255' }}>Navbar scroll</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
            <Nav.Link href="/home" style={{ color: '#61876E' }}>Home</Nav.Link>
            {userDetail.role === 1 && <Nav.Link href="/addcourt" style={{ color: '#A6BB8D' }}>Addcourt</Nav.Link>}
            <Nav.Link href="/mybookings" style={{ color: '#EAE7B1' }}>My Bookings</Nav.Link>
            <Nav.Link href="#" disabled style={{ color: '#EAE7B1' }}>
              Link
            </Nav.Link>
          </Nav>
          <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success">Search</Button>
            <Dropdown>
              <Dropdown.Toggle variant="success" id="dropdown-basic">
                {userDetail.fname}{userDetail.lname}
              </Dropdown.Toggle>
              <Dropdown.Menu>
                <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                <Dropdown.Item onClick={doLogout} href="#/action-2">Logout</Dropdown.Item>
              </Dropdown.Menu>
            </Dropdown>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavScrollExample;
